%% IFR type Re-registration checks.
re_register_test(OE_IFR)->
  case orber_ifr:'Repository_lookup_id'(OE_IFR,"IDL:omg.org/CosNotifyChannelAdmin/ConnectionAlreadyActive:1.0") of
    []  ->
      true;
    _ ->
      exit({allready_registered,"IDL:omg.org/CosNotifyChannelAdmin/ConnectionAlreadyActive:1.0"})
 end.


